    #region Field Index
    public enum TES4_FieldIndex
    {
        Fluff = 0,
        Header = 1,
        TypeOffsets = 2,
        Deleted = 3,
        Author = 4,
        Description = 5,
        MasterReferences = 6,
        VestigialData = 7,
    }
