            {
                StringXmlTranslation.Instance.Write(
                    node: elem,
                    name: nameof(item.Author),
                    item: item.Author,
                    fieldIndex: (int)TES4_FieldIndex.Author,
                    errorMask: errorMask);
            }
            if (item.Description_IsSet
