    public class TES4_TranslationMask : ITranslationMask
    {
        #region Members
        private TranslationCrystal _crystal;
        public bool Fluff;
        public MaskItem<bool, Header_TranslationMask> Header;
        public bool TypeOffsets;
        public bool Deleted;
        public bool Author;
        public bool Description;
        public MaskItem<bool, MasterReference_TranslationMask> MasterReferences;
        public bool VestigialData;
        #endregion

        #region Ctors
        public TES4_TranslationMask()
        {
        }

        public TES4_TranslationMask(bool defaultOn)
        {
            this.Fluff = defaultOn;
            this.Header = new MaskItem<bool, Header_TranslationMask>(defaultOn, null);
            this.TypeOffsets = defaultOn;
            this.Deleted = defaultOn;
            this.Author = defaultOn;
            this.Description = defaultOn;
            this.MasterReferences = new MaskItem<bool, MasterReference_TranslationMask>(defaultOn, null);
            this.VestigialData = defaultOn;
        }

        #endregion

        public TranslationCrystal GetCrystal()
        {
            if (_crystal != null) return _crystal;
            List<(bool On, TranslationCrystal SubCrystal)> ret = new List<(bool On, TranslationCrystal SubCrystal)>();
            GetCrystal(ret);
            _crystal = new TranslationCrystal()
            {
                Crystal = ret.ToArray()
            };
            return _crystal;
        }

        protected void GetCrystal(List<(bool On, TranslationCrystal SubCrystal)> ret)
        {
            ret.Add((Fluff, null));
            ret.Add((Header?.Overall ?? true, Header?.Specific?.GetCrystal()));
            ret.Add((TypeOffsets, null));
            ret.Add((Deleted, null));
            ret.Add((Author, null));
            ret.Add((Description, null));
            ret.Add((MasterReferences?.Overall ?? true, MasterReferences?.Specific?.GetCrystal()));
            ret.Add((VestigialData, null));
        }
    }
    #endregion

    #endregion

